import React, {useContext, useEffect, useState} from "react";
import Modal from "react-modal";
import axios from "axios";
import "./modal.style.css";
import {AssetContext} from "../../../context";



const ModalSelling = (props,{asset, crawledStock, isClose}) => {
  const url = "http://localhost:8080/assets/";
  const [assetId] = useState(props.assetOne.assetId);
  const [stockName, setStockName] = useState(props.assetOne.stockName);
  const [symbol, setSymbol] = useState((props.assetOne.symbol != null) ? props.assetOne.symbol : props.crawledStock.symbol);
  const [nowPrice, setNowPrice] = useState(
    (props.assetOne.nowPrice != null) ? props.assetOne.nowPrice : props.crawledStock.now);
  const [shareCount, setShareCount] = useState((props.assetOne.shareCount != null) ? props.assetOne.shareCount : 1 );
  const [totalAmount] = useState(props.assetOne.totalAsset);
  const [transactionDate, setTransactionDate] = useState(new Date());
  const [purchasePrice, setPurchasePrice] = useState(nowPrice);
  const [sellCount, setSellCount] = useState(1 );
  const [transactionType] = useState("매도");
  const {setAsset} = useContext(AssetContext);

  const decrease = (e) => {
    e.preventDefault();
    if(sellCount > 1){
      setSellCount(sellCount - 1);
      setPurchasePrice((sellCount - 1) * nowPrice);
    }else{
      alert('올바른 수량을 입력하세요.');
    }
  };
  const increase = (e) => {
    e.preventDefault();
    if(shareCount > sellCount) {
      setSellCount(sellCount + 1);
      setPurchasePrice((sellCount + 1) * nowPrice);
    } else {
      alert('올바른 수량을 입력하세요.');
    }
  };


  const submitTransaction = (e) => {
    e.preventDefault();
    const newTransaction = {
      userId : JSON.parse(sessionStorage.getItem("logined_user")).userId,
      assetId : assetId,
      stockName : stockName,
      symbol : symbol,
      shareCount: sellCount,
      nowPrice: nowPrice,
      purchasePrice: purchasePrice,
      transactionDate : new Date().toLocaleDateString(),
      transactionType : transactionType
    };
    axios
      .post(url + `sell/${JSON.parse(sessionStorage.getItem("logined_user")).userId}`, newTransaction)
      .then((response) => {
        console.log(newTransaction);
        setAsset(response.data);
        setShareCount(1);
        setPurchasePrice(nowPrice);
        props.isClose(false);
      })
      .catch((error) => {
        throw error;
      });


  };

  const modalStyle = {
    content: {
      width: "300px",
      height: "400px",
    },
  };
  return (
    <>
      <Modal {...props} style={modalStyle}>
        <span className="text_small ">{stockName}</span> <br />
        <span className="text_small" style={{ "margin-right": "8px" }}>
          현재가
        </span>
        <span className="text_small ">{nowPrice} 원</span> <br />
        <span className="text_small" style={{ "margin-right": "8px" }}>
          매도가
        </span>
        <span className="text_small ">{purchasePrice} 원</span>
        <h1>{sellCount} 주</h1>
        <div>
          <button
            className="btn btn-default bg-transparent plus_minus_btn btn-rounded btn-raised"
            onClick={decrease}
          >
            {" "}
            -1{" "}
          </button>
          <button
            className="btn btn-default bg-transparent plus_minus_btn btn-rounded btn-raised"
            onClick={increase}
          >
            {" "}
            +1{" "}
          </button>
        </div>
        <tr>
          <td>
            <button
              className="btn btn-default btn-gray btn-rounded"
              onClick={() => props.isClose()}>
              취소
            </button>
          </td>
          <td>
            <button
              className="btn btn-default btn-red btn-rounded"
              onClick={submitTransaction}>
              매도
            </button>
          </td>
        </tr>
      </Modal>
    </>
  );
};

export default ModalSelling;
